import React, {Component} from 'react';
import './App.css';

class ContactCard extends Component{
  render(){
    return <div>
              <h1>Name: {this.props.name}</h1>
              <h1>Phone Number: {this.props.number}</h1>
              <h1>Email: {this.props.email}</h1>
           </div>
  }
};


function App() {
  return <ContactCard name="Anthony"/>
}

export default App;
